    false,nt"url": null,nt"notes": "Observational reports of daily pan evaporation
    (1200 UTC to 1200 UTC) are made by members of the NWS Cooperative Network (COOP)
    or supplemental networks of NOAA's regional climate centers. Reports from approximately
    100 stations across the southern and mid-western tier of the US are collected by
    local NWS Weather Forecast Offices (WFO) and sent on a daily basis to the Climate
    Prediction Center (CPC). CPC processes these reports once per day. All reports for
    the same day are put into an ASCII text file whose name includes the date of observation.
    These data are used by CPC in its role of supporting the Joint Agricultural Weather
    Facility (JAWF).",nt"license_title": null,nt"extras": [{ntt"key":
